import { signup, signin } from '../reducers/userReduser';
import axios from 'axios';
import { PROTOCOL, SERVER_HOST, SERVER_PORT } from '../../config';
import { Dispatch } from '@reduxjs/toolkit';

const URL = `${PROTOCOL}://${SERVER_HOST}:${SERVER_PORT}`;

export const fetchSignUp = (data: object) => {
  return (dispatch: Dispatch): void => {
    const url: string = `${URL}/users/signup`;
    axios.post(url, data, { 
      headers: {
        "Content-Type": "application/json",
        "Access-Control-Allow-Origin": url,
      },
    }).then(response => {
      dispatch(signup(response.data));
    });
  }
}

export const fetchSignIn = (data: object) => {
  return (dispatch: Dispatch): void => {
    axios.post(`${URL}/users/signin`, data).then(response => {
        console.log(response);
    });
  }
}
